      <ImageToggleOnMouseOver
        primaryImg="https://homepages.cae.wisc.edu/~ece533/images/airplane.png"
        secondaryImg="https://homepages.cae.wisc.edu/~ece533/images/airplane.png"
        alt=""
      />
      &nbsp;
      <ImageToggleOnMouseOver
        primaryImg="https://homepages.cae.wisc.edu/~ece533/images/airplane.png"
        secondaryImg="https://homepages.cae.wisc.edu/~ece533/images/airplane.png"
        alt=""
      />
    </div>
  );
};

export default ImageChangeOnMouseOver;
